import React, { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState("");

  useEffect(() => {
    fetch("/api/data")
      .then(res => res.json())
      .then(data => setData(data.message));
  }, []);

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>AWS EKS Cloud Native App</h1>
      <h3>{data}</h3>
    </div>
  );
}

export default App;
